import React from "react";
import { View,Text } from "react-native";
import { StyleSheet } from "react-native";
const Login = () => {
  return (
    <View>
      <Text style={styles.title}>Bonjour</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  title: {
    fontSize: 18,
    marginTop: 10,
    color: "#00bfa6",
  }
});

export default Login;
